import React from 'react';



function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <li>Home</li>
            <li>About</li>
            <li>Blog</li>
            <li>Contact</li>
        </ul>
    </nav>
  );
}

export default Nav;
